import './App.css';
import NavBar from './NavBar';
import React, { Component } from 'react';
import News from './News';
import { BrowserRouter as Router,Switch, Routes, Route } from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <Router>
      <div>
        <NavBar/>
        <Switch>
          <Route path="/"><News pageSize = {9} category={"general"}/></Route>
          <Route path="/business"><News pageSize = {9} category={"business"}/></Route>
          <Route path="/entertainment"><News pageSize = {9} category={"entertainment"}/></Route>
          <Route path="/sports"><News pageSize = {9} category={"sports"}/></Route>
          <Route path="/health"><News pageSize = {9} category={"health"}/></Route>
          <Route path="/science"><News pageSize = {9} category={"science"}/></Route>
          <Route path="/technology"><News pageSize = {9} category={"technology"}/></Route>
        </Switch>
      </div>
      </Router>
    )
  }
}
